INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 7, 1, 7001, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 7, 1, 7002, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 7, 1, 7003, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 10, 1, 10001, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 10, 1, 10002, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 10, 1, 10003, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 10, 1, 10004, 2104010, "シェフィ", 0, 2, 106401, "2015/12/17 15:00:00", 0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 12, 1, 12001, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", -416.5, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 13, 1, 13001, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 13, 1, 13002, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 13, 1, 13003, 2104010, "シェフィ", 0, 2, 106401, "2015/12/17 15:00:00", 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 13, 1, 13004, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 14, 1, 14001, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 14, 1, 14002, 2104010, "シェフィ", 0, 2, 106401, "2015/12/17 15:00:00", 0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 14, 1, 14003, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 14, 1, 14004, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 15, 1, 15001, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", -470.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 16, 1, 16001, 2104010, "シェフィ", 0, 2, 106401, "2015/12/17 15:00:00", 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 16, 1, 16002, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 16, 1, 16003, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 16, 1, 16004, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 17, 1, 17002, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 25, 1, 17004, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 25, 1, 17005, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 25, 1, 17006, 2104010, "シェフィ", 0, 2, 106401, "2015/12/17 15:00:00", 0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 25, 1, 17007, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 18, 1, 18001, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 18, 1, 18002, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (3, 19, 1, 19001, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", -470.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (4, 19, 1, 19002, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", -470.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (5, 20, 1, 20001, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", -470.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (6, 20, 1, 20002, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", -470.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 21, 1, 21001, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 21, 1, 21002, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 21, 1, 21003, 2104010, "シェフィ", 0, 2, 106401, "2015/12/17 15:00:00", 0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 21, 1, 21004, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 22, 1, 22001, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", -430.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 22, 1, 22002, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", -430.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (3, 23, 1, 23001, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", -430.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (4, 23, 1, 23002, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", -430.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 24, 2, 24001, 0, "エリコ（バレンタイン）", 10011, 1, 109001, "2019/01/31 12:00:00", 4.08, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", -385.0, 8.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 24, 2, 24002, 0, "エリコ（バレンタイン）", 10011, 1, 109001, "2019/01/31 12:00:00", 5.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", -385.0, 8.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (3, 24, 2, 24003, 0, "エリコ（バレンタイン）", 10011, 1, 109001, "2019/01/31 12:00:00", 10.11, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", -385.0, 8.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (4, 24, 2, 24004, 0, "エリコ（バレンタイン）", 10011, 1, 109001, "2019/01/31 12:00:00", 4.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", -385.0, 8.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (5, 24, 2, 24005, 0, "エリコ（バレンタイン）", 10011, 1, 109001, "2019/01/31 12:00:00", 6.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", -385.0, 8.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (6, 24, 1, 24006, 0, "エリコ（バレンタイン）", 10011, 1, 109002, "2019/01/31 12:00:00", 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (7, 24, 1, 24007, 0, "エリコ（バレンタイン）", 10011, 1, 109002, "2019/01/31 12:00:00", 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (8, 24, 1, 24008, 0, "エリコ（バレンタイン）", 10011, 1, 109002, "2019/01/31 12:00:00", 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (9, 24, 1, 24009, 0, "エリコ（バレンタイン）", 10011, 1, 109002, "2019/01/31 12:00:00", 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10, 24, 1, 24010, 0, "エリコ（バレンタイン）", 10011, 1, 109002, "2019/01/31 12:00:00", 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 24, 2, 24011, 0, "シズル（バレンタイン）", 10011, 1, 109101, "2019/01/31 12:00:00", 2.12, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", -385.0, 8.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 24, 2, 24012, 0, "シズル（バレンタイン）", 10011, 5, 109101, "2019/01/31 12:00:00", 4.19, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", -385.0, 8.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (3, 24, 4, 24013, 0, "シズル（バレンタイン）", 10011, 2, 109101, "2019/01/31 12:00:00", 2.3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", -385.0, 8.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (4, 24, 1, 24014, 0, "シズル（バレンタイン）", 10011, 1, 109102, "2019/01/31 12:00:00", 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (5, 24, 2, 24015, 0, "シズル（バレンタイン）", 10011, 5, 109101, "2019/01/31 12:00:00", 5.23, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", -385.0, 8.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (6, 24, 1, 24016, 0, "シズル（バレンタイン）", 10011, 1, 109102, "2019/01/31 12:00:00", 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (7, 24, 2, 24017, 0, "シズル（バレンタイン）", 10011, 1, 109101, "2019/01/31 12:00:00", 5.01, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", -385.0, 8.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (8, 24, 1, 24018, 0, "シズル（バレンタイン）", 10011, 1, 109102, "2019/01/31 12:00:00", 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (9, 24, 1, 24019, 0, "シズル（バレンタイン）", 10011, 1, 109102, "2019/01/31 12:00:00", 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10, 24, 1, 24020, 0, "シズル（バレンタイン）", 10011, 1, 109102, "2019/01/31 12:00:00", 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 26, 1, 26001, 2104010, "シェフィ", 0, 2, 106401, "2015/12/17 15:00:00", 0.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 26, 1, 26002, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 26, 1, 26003, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 26, 1, 26004, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 27, 1, 27001, 2104010, "シェフィ", 0, 2, 106401, "2015/12/17 15:00:00", 0.0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 27, 1, 27002, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 27, 1, 27003, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 27, 1, 27004, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 28, 1, 28001, 0, "カリン", 0, 1, 190801, "2019/09/24 15:00:00", 0.0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 28, 1, 28002, 0, "カリン", 0, 1, 190801, "2019/09/24 15:00:00", 0.0, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (3, 29, 1, 29001, 0, "カリン", 0, 1, 190801, "2019/09/24 15:00:00", 0.0, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", -409.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (4, 29, 1, 29002, 0, "カリン", 0, 1, 190801, "2019/09/24 15:00:00", 0.0, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", -409.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (5, 30, 1, 30001, 0, "カリン", 0, 1, 190801, "2019/09/24 15:00:00", 0.0, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", -409.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (6, 30, 1, 30002, 0, "カリン", 0, 1, 190801, "2019/09/24 15:00:00", 0.0, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", -409.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (7, 31, 1, 31001, 0, "カリン", 0, 1, 190801, "2019/10/31 12:00:00", 0.0, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", -409.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (8, 31, 1, 31002, 0, "カリン", 0, 1, 190801, "2019/10/31 12:00:00", 0.0, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", -409.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 32, 1, 32001, 0, "カリン", 0, 1, 190801, "2019/12/20 5:00:00", 0.0, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", -409.0, 0.0, "2020/01/04 4:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 32, 1, 32002, 0, "カリン", 0, 1, 190801, "2019/12/20 5:00:00", 0.0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", -409.0, 0.0, "2020/01/04 4:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (3, 33, 1, 33001, 0, "カリン", 0, 1, 190801, "2019/12/20 5:00:00", 0.0, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", -409.0, 0.0, "2020/01/04 4:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (4, 33, 1, 33002, 0, "カリン", 0, 1, 190801, "2019/12/20 5:00:00", 0.0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", -409.0, 0.0, "2020/01/04 4:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (5, 34, 1, 34001, 0, "カリン", 0, 1, 190801, "2020/01/04 5:00:00", 0.0, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", -409.0, 0.0, "2020/01/10 11:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (6, 34, 1, 34002, 0, "カリン", 0, 1, 190801, "2020/01/04 5:00:00", 0.0, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", -409.0, 0.0, "2020/01/10 11:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 38, 2, 38001, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 5.3, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", -458.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 38, 2, 38002, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 6.5, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", -458.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, 39, 3, 39005, 0, "ペコリーヌ", 0, 3, 105801, "2020/04/01", 0.0, "", 9999.0, 9999.0, "2020/04/08 23:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 40, 1, 40001, 0, "カリン", 0, 1, 190801, "2015/12/17 15:00:00", 0.0, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", -430.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 41, 1, 41001, 2104010, "シェフィ", 0, 1, 106401, "2015/12/17 15:00:00", 0.0, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 41, 1, 41002, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 41, 1, 41003, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 41, 1, 41004, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 42, 1, 42001, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", -416.5, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 42, 1, 42002, 2104010, "シェフィ", 0, 1, 106401, "2015/12/17 15:00:00", 0.0, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", -416.5, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 42, 1, 42003, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", -416.5, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 42, 1, 42004, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", -416.5, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 43, 1, 43001, 0, "ペコリーヌ", 0, 1, 105801, "2015/12/17 15:00:00", 0.0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 43, 1, 43002, 0, "コッコロ", 0, 1, 105901, "2015/12/17 15:00:00", 0.0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 43, 1, 43003, 0, "キャル", 0, 1, 106001, "2015/12/17 15:00:00", 0.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", -363.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 44, 1, 43004, 0, "アメス", 0, 1, 123001, "2015/12/17 15:00:00", 0.0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", -416.5, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 44, 1, 43005, 0, "アメス", 0, 1, 123001, "2015/12/17 15:00:00", 0.0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", -416.5, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (3, 45, 2, 43006, 0, "アメス", 0, 1, 123001, "2015/12/17 15:00:00", 5.79, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", -416.5, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 46, 1, 46001, 0, "アメス", 0, 1, 123001, "2015/12/17 15:00:00", 0.0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", -371.5, 0.0, "2030/12/17 14:59:59");
